    public static ArrayList<Youtuber> fetchList(int offset){
        final int pagePerItem = 20;
        ArrayList<Youtuber> resultList = new ArrayList<Youtuber>();
        for(int i = 0; i < pagePerItem; i++){
            if(list.size() <= i+offset) break;
            resultList.add(Youtubers.list.get(i + offset));
        }
        return resultList;
    }
